$(document).ready(function () {
	appendBlocks();
	
	var typingTimer;
	var doneTypingInterval = 50;

	$('#search').keyup(function(){
	    clearTimeout(typingTimer);
	    typingTimer = setTimeout(doneTyping, doneTypingInterval);
	});

	$('#search').keydown(function(){
	    clearTimeout(typingTimer);
	});

	var loved = JSON.parse(localStorage.getItem('loved')) === null ? [] : JSON.parse(localStorage.getItem('loved'));
	localStorage.setItem('loved', JSON.stringify(loved));

	var hated = JSON.parse(localStorage.getItem('hated')) === null ? [] : JSON.parse(localStorage.getItem('hated'));
	localStorage.setItem('hated', JSON.stringify(hated));
	
	var feared = JSON.parse(localStorage.getItem('feared')) === null ? [] : JSON.parse(localStorage.getItem('feared'));
	localStorage.setItem('feared', JSON.stringify(feared));

	$('#square-grid .square').each(function () {
		var id = $(this)[0].id.split('-')[1];

		if (loved[id]) {
			$(this).find('a.love').addClass('selected-feeling');
		}

		if (hated[id]) {
			$(this).find('a.hate').addClass('selected-feeling');
		}

		if (feared[id]) {
			$(this).find('a.fear').addClass('selected-feeling');	
		}
	});

	$('a.love').click(function () {

		var id = $(this).parent().parent().parent()[0].id.split('-')[1];
		var loved = localStorage.getItem('loved') ? JSON.parse(localStorage.getItem('loved')) : [];
		
		if (loved[id]) {
			loved[id] = false;
			$(this).removeClass('selected-feeling');
		}
		else {
			loved[id] = true;
			$(this).addClass('selected-feeling');
		}

		localStorage.setItem('loved', JSON.stringify(loved));
	});

	$('a.hate').click(function () {

		var id = $(this).parent().parent().parent()[0].id.split('-')[1];
		var hated = localStorage.getItem('hated') ? JSON.parse(localStorage.getItem('hated')) : [];
		
		if (hated[id]) {
			hated[id] = false;
			$(this).removeClass('selected-feeling');
		}
		else {
			hated[id] = true;
			$(this).addClass('selected-feeling');
		}

		localStorage.setItem('hated', JSON.stringify(hated));
	});

	$('a.fear').click(function () {

		var id = $(this).parent().parent().parent()[0].id.split('-')[1];
		var hated = localStorage.getItem('feared') ? JSON.parse(localStorage.getItem('feared')) : [];
		
		if (feared[id]) {
			feared[id] = false;
			$(this).removeClass('selected-feeling');
		}
		else {
			feared[id] = true;
			$(this).addClass('selected-feeling');
		}

		localStorage.setItem('feared', JSON.stringify(feared));
	});

	$('#filter-love').click(function () {

		$('#square-grid').children().removeClass('hidden');
		
		if ($(this).hasClass('selected-filter')) {
			$(this).removeClass('selected-filter');	
			return;
		}
		else {
			$(this).addClass('selected-filter');
			$('#filter-hate').removeClass('selected-filter');
			$('#filter-fear').removeClass('selected-filter');
		}

		var loved = JSON.parse(localStorage.getItem('loved'));
		$('#square-grid').children().each(function () {
			
			var id = $(this)[0].id.split('-')[1];

			if (loved[id]) {
				$(this).removeClass('hidden');
			}
			else {
				$(this).addClass('hidden');
			}
		});
	});

	$('#filter-hate').click(function () {

		$('#square-grid').children().removeClass('hidden');
		
		if ($(this).hasClass('selected-filter')) {
			$(this).removeClass('selected-filter');	
			return;
		}
		else {
			$(this).addClass('selected-filter');
			$('#filter-love').removeClass('selected-filter');
			$('#filter-fear').removeClass('selected-filter');
		}

		var hated = JSON.parse(localStorage.getItem('hated'));
		$('#square-grid').children().each(function () {
			
			var id = $(this)[0].id.split('-')[1];
			
			if (hated[id]) {
				$(this).removeClass('hidden');
			}
			else {
				$(this).addClass('hidden');
			}
		});
	});

	$('#filter-fear').click(function () {

		$('#square-grid').children().removeClass('hidden');
		
		if ($(this).hasClass('selected-filter')) {
			$(this).removeClass('selected-filter');	
			return;
		}
		else {
			$(this).addClass('selected-filter');
			$('#filter-love').removeClass('selected-filter');
			$('#filter-hate').removeClass('selected-filter');
		}

		var hated = JSON.parse(localStorage.getItem('feared'));
		$('#square-grid').children().each(function () {
			
			var id = $(this)[0].id.split('-')[1];
			
			if (feared[id]) {
				$(this).removeClass('hidden');
			}
			else {
				$(this).addClass('hidden');
			}
		});
	});

});

function doneTyping () {
    
    var keyword = $('#search').val().toLowerCase();
	
	$('#square-grid').children().each(function () {
		var text = $(this).html().toLowerCase();
		if (text.indexOf(keyword) == -1) {
			$(this).addClass('hidden');
		}
		else {
			$(this).removeClass('hidden');
		}
	});
}

function appendBlocks() {

	for (var i = 0; i < blocks.length; i++) {
		$('#square-grid').append('<div id="square-'+ blocks[i].id +'" class="square"></div>');

		var cur = $('#square-' + blocks[i].id);
		
		cur.click(showInfo());
		cur.append('<div class="square-top"></div><div class="square-bottom"></div>');

		curTop = cur.children('.square-top');
		curBot = cur.children('.square-bottom');

		curTop.append('<img class="website-screenshot" src="compressed/screenshot-'+ blocks[i].id + '.jpg" />');

		curTop.append('<a class="here" href="'+blocks[i].url+'" target="_blank" ><img class="website-logo" src="'+ blocks[i].logo + '" /></a>');

		websiteLink = curTop.children('.websitelink');
		websiteLink.append('<p class="website-url ">' + blocks[i].url + '</p>');
		curTop.append('<p class="website-font">' + blocks[i].fontFamily + '</p>');
		var libraries = "";


		if (blocks[i].windowKeys.indexOf('jQuery') != -1) {
			libraries = libraries + '<img src="data:image/png;base64,">';
		}

		if (blocks[i].windowKeys.indexOf('Drupal') != -1) {
			libraries = libraries + '<img src="data:image/png;base64,">';
		}

		if (blocks[i].windowKeys.indexOf('Modernizr') != -1) {
			libraries = libraries + '<img src="data:image/png;base64,">';
		}

		if (blocks[i].windowKeys.indexOf('Bacon') != -1) {
			libraries = libraries + " Bacon.js";
		}


		curTop.append('<p class="website-libraries">' + libraries + '</p>');
		curTop.children('.website-font').css('font-family', blocks[i].fontFamily);

		curBot.append('<div class="website-colors"></div>');
		curBot.append('<div class="social"><a class="love"></a><a class="hate"></a><a class="fear"></a></div>');

		var colors = $('#square-' + blocks[i].id + ' .website-colors');
		colors.append('<div class="top-colors"></div>');
		colors.append('<div class="all-colors"></div>');
		
		if (typeof blocks[i].colours !== 'undefined') {

			var length = blocks[i].colours.length; //< 3 ? blocks[i].colours.length : 3;
			var width = colors.width();
			
			for (var j = 0; j < length; j++) {
				var color = blocks[i].colours[j];
				
				var rgb = color;
				var colorString = 'rgb('+ rgb[0] +',' + rgb[1] + ',' + rgb[2] + ')';

				if (true) {
					colors.children('.top-colors').append('<div class="color"></div>');
					colors.children('.top-colors').children().last().css({'background-color': colorString, width: (width / length) + 'px'});
				}
				
				//colors.children('.all-colors').append('<div class="color"></div>');
				//colors.children('.all-colors').children().last().css({'background-color': colorString, width: (350 / length ) + 'px'});

				
				
			};
		}
	};
	

}
